import React from 'react';
import img from './img/grs.jpg';
import img1 from './img/grs1.jpg';
import img2 from './img/grs2.jpg';

const Card =() =>{
    return(
        <div>
            <img alt ='grass' src={img}/>
            <div>
                <h2>Grass1</h2>
                <p>10</p>
            </div>
        </div>
    )
}

export default Card;
